import React, { Component } from 'react';

class Envelope extends Component { 

	render() {

		const template = "data:image/jpeg;base64,";
		const h = 370;

		// #10 envelope ratio is 2.3
		const w = h * 2.3;

		var css = {
			width: h,  // this is portrait, so this is reversed
			height: w,
			left:'12px',
			top:'32px',
			position:'absolute'
		};

		return (
			<div>

				{/*Without this the popup will look like a tetris piece*/}
				<div style={{height:'900px'}}>
				</div>

				{/*<div style={{left:'0px', top:'0px', width:'1600px', position:'absolute', border:'1px solid red'}}>*/}
				<img src={template} style={css} alt="" />
				

			</div>
		);
	}
}

export default Envelope;
